import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div class="title">
      <h1>Header</h1>
      <p>My supercool header</p>
      <div class="child-1">Puppy!</div>
      <div class="child-2">Dog!</div>
      <div class="child-3">Hi!</div>
    </div>
  );
}

export default App;
